import React, { useState } from 'react';

import './App.css';

import PathGuider from './PathGuider';

function App() {
  const [currentPage, setCurrentPage] = useState('home');

  const renderPage = () => {
    switch (currentPage) {
      case 'home':
        return <Home />;
      case 'about':
        return <About/>;
      case 'pricing':
        return <Pricing />;
      case 'documentation':
        return <Docs/>;
      case 'contact':
        return <Contact/>;
      default:
        return <PathGuider />;
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      <Header currentPage={currentPage} setCurrentPage={setCurrentPage} />
      <main>
        {renderPage()}
      </main>
      <Footer />
    </div>
  );
}

export default App;
